        gdjs.evtTools.runtimeScene.replaceScene(runtimeScene,"Online_HUB");
        _p2p.sendDataToAll("startGame","none");
    }
}

const _p2p = gdjs.evtTools.p2p;
let multiplayerID = runtimeScene.getGame().getVariables().get("MultiplayerID");

if(_p2p.onConnection()){
    _p2p.sendDataToAll("connectHost","none");
}

if(_p2p.onEvent("getID",false)){
    multiplayerID.setValue(_p2p.getEventData("getID"));
}

if(_p2p.onEvent("returnID",false)){
    _p2p.connect(_p2p.getEventData("returnID"));
    _p2p.sendDataToAll("connectAll","none");
}

if(_p2p.onEvent("startGame",false)){
    gdjs.evtTools.runtimeScene.replaceScene(runtimeScene,"Online_HUB");
}

/**
 * 半角が入力されているか確かめます
 * @param {str} 確かめたい文字列
 * @return {boolean} 真偽値
 */
function isHankaku(str){
  str = (str==null)?"":str;
  if(str.match(/^[\x20-\x7e]*$/)){
    return true;
  }else{
    return false;
  }
}

